import axios from "axios";
import React, { useEffect, useState } from "react";

const StockPicks: React.FC = () => {
  const [data, setData] = useState<any[][]>([]);
  const [error, setError] = useState<string | null>(null);
  const [isLoading, setIsLoading] = useState(true);

  // Sheet configuration
  const SHEET_ID = "1tRLI64dU83Fcit_YAKfKhvlmfctRp7c5SMA_A7XMTkE";
  const SHEET_NAME = "Sheet1";
  const API_KEY = "AIzaSyAC511tUxujeEh1TkYVejr3HozvJkiaZ-8";

  const styles = {
    container: {
      padding: "20px",
      maxWidth: "800px",
      margin: "0 auto",
    },
    title: {
      fontSize: "2rem",
      fontWeight: "bold",
      marginBottom: "2rem",
      textAlign: "center" as const,
    },
    stockCard: {
      border: "1px solid #e5e7eb",
      borderRadius: "8px",
      padding: "1.5rem",
      marginBottom: "1.5rem",
      backgroundColor: "white",
      boxShadow: "0 1px 3px 0 rgba(0, 0, 0, 0.1)",
      width: "100%",
    },
    stockHeader: {
      display: "flex",
      justifyContent: "space-between",
      alignItems: "flex-start",
      marginBottom: "1rem",
    },
    stockTitle: {
      fontSize: "1.5rem",
      fontWeight: "bold",
      color: "#111827",
    },
    companyName: {
      fontSize: "1rem",
      color: "#6b7280",
      marginTop: "0.25rem",
    },
    badge: {
      padding: "0.25rem 0.75rem",
      borderRadius: "9999px",
      fontSize: "0.875rem",
      fontWeight: "500",
    },
    section: {
      marginBottom: "1rem",
    },
    label: {
      fontSize: "0.875rem",
      color: "#6b7280",
      marginBottom: "0.25rem",
    },
    value: {
      fontSize: "1rem",
      color: "#111827",
      fontWeight: "500",
    },
    thesis: {
      fontSize: "0.875rem",
      color: "#374151",
      lineHeight: "1.5",
    },
    metrics: {
      marginTop: "1rem",
      display: "grid",
      gridTemplateColumns: "repeat(auto-fit, minmax(150px, 1fr))",
      gap: "1rem",
    },
    error: {
      color: "#dc2626",
      padding: "1rem",
      backgroundColor: "#fee2e2",
      borderRadius: "0.5rem",
      marginBottom: "1rem",
    },
    loading: {
      textAlign: "center" as const,
      padding: "2rem",
      color: "#6b7280",
    },
  };

  const getSectorStyle = (sector: string) => {
    const sectorStyles: { [key: string]: React.CSSProperties } = {
      Technology: {
        backgroundColor: "#dbeafe",
        color: "#1e40af",
      },
      Healthcare: {
        backgroundColor: "#dcfce7",
        color: "#166534",
      },
      Finance: {
        backgroundColor: "#f3e8ff",
        color: "#6b21a8",
      },
      Consumer: {
        backgroundColor: "#fef9c3",
        color: "#854d0e",
      },
      Energy: {
        backgroundColor: "#fee2e2",
        color: "#991b1b",
      },
      Industrial: {
        backgroundColor: "#f3f4f6",
        color: "#1f2937",
      },
    };
    return sectorStyles[sector] || sectorStyles.Industrial;
  };

  useEffect(() => {
    const fetchData = async () => {
      setIsLoading(true);
      try {
        const response = await axios.get(
          `https://sheets.googleapis.com/v4/spreadsheets/${SHEET_ID}/values/${SHEET_NAME}?key=${API_KEY}`
        );
        if (response.data && response.data.values) {
          setData(response.data.values.slice(1)); // Skip header row
          setError(null);
        } else {
          setError("No data received from the Google Sheet");
        }
      } catch (error) {
        console.error("Error fetching data:", error);
        if (axios.isAxiosError(error)) {
          setError(
            error.response?.status === 403
              ? "Access denied. Please check sheet permissions and API key."
              : `Error: ${
                  error.response?.data?.error?.message || error.message
                }`
          );
        } else {
          setError("An unexpected error occurred");
        }
      } finally {
        setIsLoading(false);
      }
    };

    fetchData();
  }, []);

  if (isLoading) {
    return <div style={styles.loading}>Loading stock picks...</div>;
  }

  if (error) {
    return <div style={styles.error}>{error}</div>;
  }

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Jack's Stock Picks</h1>
      {data.map((stock, index) => (
        <div key={index} style={styles.stockCard}>
          <div style={styles.stockHeader}>
            <div>
              <div style={styles.stockTitle}>{stock[0]}</div>
              <div style={styles.companyName}>{stock[1]}</div>
            </div>
            <span style={{ ...styles.badge, ...getSectorStyle(stock[2]) }}>
              {stock[2]}
            </span>
          </div>

          <div style={styles.section}>
            <div style={styles.label}>Current Price</div>
            <div style={styles.value}>${stock[3]}</div>
          </div>

          <div style={styles.section}>
            <div style={styles.label}>Target Price</div>
            <div style={styles.value}>${stock[4]}</div>
          </div>

          <div style={styles.section}>
            <div style={styles.label}>Investment Thesis</div>
            <div style={styles.thesis}>{stock[5]}</div>
          </div>

          <div style={styles.metrics}>
            <div>
              <div style={styles.label}>P/E Ratio</div>
              <div style={styles.value}>{stock[6]}</div>
            </div>
            <div>
              <div style={styles.label}>Dividend Yield</div>
              <div style={styles.value}>{stock[7]}%</div>
            </div>
            <div>
              <div style={styles.label}>Market Cap</div>
              <div style={styles.value}>${stock[8]}B</div>
            </div>
          </div>
        </div>
      ))}
    </div>
  );
};

export default StockPicks;
